<script>
export default {
  name: 'SVGBtn',
  data() {
   return {
     defSell: false,
     actSell: false,
     hovSell: false,
     defBUY: false,
     actBUY: false,
     hovBUY: false
   }
  },
  methods:{
    onMouseOut(){
      this.hovSell = false
      this.defSell = false
    },
    onMouseOver(){
      if(!this.actSell) {
        this.hovSell = true
        this.defSell = true
      }
    },
    onMouseOutBUY(){
      console.log("buy")
      this.hovBUY = false
      this.defBUY = false
    },
    onMouseOverBUY(){
      console.log("over")
      if(!this.actBUY) {
        this.hovBUY = true
        this.defBUY = true
      }else {
        this.hovBUY = false
        this.defBUY = false
      }
    },
    clickSell(){
      if(!this.actBUY) {
        this.actSell = !this.actSell
        this.hovBUY = false
      }
    },
    clickBuy(){
      if(!this.actSell) {
        this.actBUY = !this.actBUY
        this.hovBUY = false
      }
    }
  }
}
</script>

